import * as React from 'react';
import {
  Text,
  View,
  StyleSheet,
  FlatList,
  TouchableOpacity,
} from 'react-native';

export default class App extends React.Component {
  constructor(propos) {
    super(propos);
    this.state = {
      pessoa: [
        { tipo: 'MASCULINO' },
        { tipo: 'FEMININO' },
        { tipo: 'INFANTIL' },
      ],
    };
  }
  render() {
    return (
      <View style={styles.tela}>
        <View style={styles.categoria}>
          <Text style={{ color: 'white', fontSize: 20}}> Categoria</Text>
        </View>

        <FlatList
          data={this.state.pessoa}
          renderItem={({ item }) => (
            <TouchableOpacity style={styles.item}>
              <Text style={{ fontWeight: 'bold' }}>{item.tipo}</Text>
            </TouchableOpacity>
          )}
        />
      </View>
    );
  }
}

const styles = StyleSheet.create({
  tela: {
    backgroundColor: '#dfeaf4',
  },
  categoria: {
    alignItems: 'center',
    backgroundColor: '#993399',
    padding: 12,
    marginBottom: 20
  },
  item: {
    backgroundColor: '#ffffff',
    padding: 20,
    marginVertical: 8,
    marginHorizontal: 16,
  },
});
